def n(e):
    
    return len(binary(e))

def h(e):
    ns = binary(e)
    return len(ns)-len(ns.replace("1",""))

def maxones(e):
    ns = binary(e)
    l1 = len(ns)
    for i in range(l1,0,-1):
        if("1"*i in ns):
            return i,(l1-len(ns.replace("1"*i,"")))//i
    return len(ns),1

def maxzeros(e):
    ns = binary(e)
    l1 = len(ns)
    for i in range(l1,0,-1):
        if("0"*i in ns):
            return i-1,(l1-len(ns.replace("0"*i,"")))//i
    return len(ns),1

def binary(e,patch=None):
    bs = bin(e)[2:]
    if(patch is not None):
        if(patch>0):
            return ("0"*(patch-len(bs))) + bs
        else:
            if(e==0):
                return ""
    return bs

def decimal(bs):
    if(len(bs)==0):
        return 0
    return int(bs,2)
